import React, {use} from 'react';
import { faEllipsisV } from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

const Navigation = () => {


  return (
    <FontAwesomeIcon
      icon={faEllipsisV}
      size={'2x'}
      style={{ cursor: 'pointer' }}
    />
  );
};

export default Navigation;
